import './Dolls.css'

function Dolls(props) {
  const name = props.name;
  const price = props.price;
  const height = props.height;

  return (
    <div className='expenses'>
      <div>{name}</div>
      <div>{price}</div>
      <div>{height}</div>
    </div>
  );
}

export default Dolls;
